<?php

namespace Tests\Feature;

use App\Models\Mail;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Illuminate\Support\Facades\DB;
use Tests\TestCase;

const API_KEY = "123-456-7890";

class MailTest extends TestCase
{

    public function testValidationError() {
        $post_data = array();
        $response = $this->postJson('/api/send/'.API_KEY, $post_data, ['Content-Type' => "application/json", 'Accept' => "application/json"]);
        $data =  json_decode($response->getContent(), true);
        $message = $data['message'];
        $errors = $data['errors'];
        $this->assertEquals('The given data was invalid.', $message);
        foreach ($errors as $key => $error) {
            $this->assertEquals('emails', $key);
        }
    }

    public function testMailValidationError() {
        $post_data['emails'][] = [
            "mail" => "arvinder.singh",
            "subject" => "Email 2",
            "body" => "No Attachments",
        ];
        $response1 = $this->postJson('/api/send/'.API_KEY, $post_data, ['Content-Type' => "application/json", 'Accept' => "application/json"]);
        $data=  json_decode($response1->getContent(), true);
        $message = $data['message'];
        $errors = $data['errors'];
        $this->assertEquals('The given data was invalid.', $message);
        foreach ($errors as $key => $error) {
            $this->assertEquals("The emails.0.mail must be a valid email address.", $error[0]);
        }
    }

    public function testSubjectValidationError() {
        $post_data['emails'][] = [
            "mail" => "arvinder.arjinder@gmail.com",
            "body" => "No Attachments",
        ];
        $response1 = $this->postJson('/api/send/'.API_KEY, $post_data, ['Content-Type' => "application/json", 'Accept' => "application/json"]);
        $data=  json_decode($response1->getContent(), true);
        $message = $data['message'];
        $errors = $data['errors'];
        $this->assertEquals('The given data was invalid.', $message);
        foreach ($errors as $key => $error) {
            $this->assertEquals("The emails.0.subject field is required.", $error[0]);
        }
    }

    public function testBodyValidationError() {
        $post_data['emails'][] = [
            "mail" => "arvinder.arjinder@gmail.com",
            "subject" => "Email 2",
        ];
        $response = $this->postJson('/api/send/'.API_KEY, $post_data, ['Content-Type' => "application/json", 'Accept' => "application/json"]);
        $data=  json_decode($response->getContent(), true);
        $message = $data['message'];
        $errors = $data['errors'];
        $this->assertEquals('The given data was invalid.', $message);
        foreach ($errors as $key => $error) {
            $this->assertEquals("The emails.0.body field is required.", $error[0]);
        }
    }

    /**
     *
     * @return void
     */
    public function testMailSent()
    {
        $to = "arvinder.arjinder@gmail.com";
        $subject = "test subject";
        $body = "test body";

        $post_data['emails'][] = [
                "mail" => "arvinder.singh@parsoftwares.com",
                "subject" => "Hello 5, how are you?",
                "body" => "I am sending this email for testing attachments",
                "attachments" => [
                    ["name" => "spiderman", "content" =>""
                    ]
                ]
            ];
        $post_data['emails'][] = [
            "mail" => "arvinder.singh@parsoftwares.com",
            "subject" => "Email 2",
            "body" => "No Attachments",
        ];

        $mailMaxId = DB::table('mails')->max('id');


        $response = $this->postJson('/api/send/'.API_KEY, $post_data, ['Content-Type' => "application/json", 'Accept' => "application/json"]);
        $data =  json_decode($response->getContent(), true);
        $response->assertStatus(200);
        $this->assertEquals("success", $data['message']);

        $mails = DB::table('mails')->where('id', '>', $mailMaxId)
            ->orderBy('id', 'asc')
            ->get()
            ->toArray();
        $i=0;
        foreach($mails as $mail) {
            $this->assertEquals($post_data['emails'][$i]['mail'], $mail->email);
            $this->assertEquals($post_data['emails'][$i]['subject'], $mail->subject);
            $this->assertEquals($post_data['emails'][$i]['body'], $mail->body);
            $i++;
        }
    }

    public function testMailIndex() {
        $response = $this->get('/api/list/'.API_KEY);
        $data =  json_decode($response->getContent(), true);
        $emails = $data['data'];
        $meta = $data['meta'];
        $response->assertStatus(200);
        $this->assertGreaterThan(0, $meta['total']);
        foreach($emails as $email) {
            $this->assertGreaterThan(0, $email['id']);
            $this->assertMatchesRegularExpression('/^.+\@\S+\.\S+$/',$email['email']);
            $this->assertIsString($email['subject']);
            $this->assertIsString($email['body']);
        }
    }
}
